import React, { Component } from 'react';
import './App.css';

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      items: [],
      isLoaded: false,
    }
  }

  componentDidMount() {
    fetch('https://anapioficeandfire.com/api/houses')
      .then(res => res.json())
      .then(json => {
        this.setState({
          isLoaded: true,
          items: json,
        })
      });
  }

  render() {
    var { isLoaded, items } =  this.state;

    if(!isLoaded) {
      return <div>Loading..</div>;
    }
    else {
      return (
        <div className="test">
          <ul classNme="">
            {items.map(item => (
              <li key={item.name}>
                Name: {item.name}
              </li>
            ))};
          </ul>
        </div>
      )
    }
  }
} 

export default App;
